import ReactDOM from "react-dom/client";
import React from "react";

function Contact() {
  const scrollToBottom = () =>{ 
    window.scrollTo({ 
      top: document.documentElement.scrollHeight, 
      behavior: 'auto'
      /* you can also use 'auto' behaviour 
         in place of 'smooth' */
    }); 
  };
  
}

export default Contact;
